import { BrowserRouter, Route, Routes } from 'react-router-dom';
import ListadoEmpleados from './empleados/ListadoEmpleados';
import Navegacion from './plantillas/Navegacion';
function App() {
  return (
    <div className="container">
      <BrowserRouter>
        <Navegacion/>
        <Routes>
          <Route exact path = "/"></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
